  };

  render() {
    return (
      <div className="main-dashboard-container">
        <h3 className="page-title" style={{ marginLeft: "1rem" }}>
          Business Requests
        </h3>
        <div className="business-request-tabs-container">
          <button>Pending</button>
          <button>Approved</button>
          <button>Decline</button>
        </div>
        <div className="container-fluid" style={{ paddingTop: "14.5rem" }}>
          <Table
            head={data.tHeadPendingBusinessTable}
            body={data.tBodyPendingBusinessTable}
            method={this.passedFromChild}
          />
        </div>
      </div>
    );
  }
}
